wikieditor-toolbar-tool-link:
A tooltip on a toolbar button that adds a link (internal or external).

Appears in the same section with the following:
* {{msg-mw|wikieditor-toolbar-tool-file}}
* {{msg-mw|templatewizard-dialog-title}} (on wikis where the TemplateWizard extension is installed)

{{Identical|Link}}

wikieditor-toolbar-tool-file:
A tooltip on a toolbar button that adds a file (image, audio, or video).

Appears in the same section with the following:
* {{msg-mw|wikieditor-toolbar-tool-link}}
* {{msg-mw|wikieditor-toolbar-tool-file}}
* {{msg-mw|templatewizard-dialog-title}} (on wikis where the TemplateWizard extension is installed)

wikieditor-toolbar-group-format:
A label for a group of toolbar buttons that includes buttons such as:
* {{msg-mw|wikieditor-toolbar-tool-ulist}}
* {{msg-mw|wikieditor-toolbar-tool-olist}}
* {{msg-mw|wikieditor-toolbar-tool-nowiki}}
* {{msg-mw|wikieditor-toolbar-tool-newline}}

{{Identical|Format}}

